INSERT INTO `hotels` (`id`, `hotel_id`, `hotel_name`, `city`, `description`, `country_trans`, `address`, `accommodation_type_name`, `review_score`, `checkin`, `checkout`, `currencycode`, `min_total_price`, `hotel_thumbnail`, `latitude`, `longitude`, `url`, `status`, `map_preview_url`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 7687885, 'Hotel Anam', 'Mumbai', 'Stay in the heart of Mumbai.\nConveniently set in Mumbai, Hotel Anam provides air-conditioned rooms with free WiFi, free private parking and room service. Popular points of interest nearby include Hanging Gardens, Kamala Nehru Park and Mohd Ali Road. The accommodations features a 24-hour front desk, a tour desk and currency exchange for guests.\n\nAt the hotel, each room includes a desk, a flat-screen TV, a private bathroom, bed linen and towels. All units include a wardrobe.\n\nPopular points of interest near Hotel Anam include Girgaum Chowpatty Beach, Chor Bazaar and Girgaon Chowpatty Beach. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 9.9 mi from the accommodations.', 'India', NULL, 'Hotel', '6', '12:00', '10:00', 'INR', '2351.9999943674', 'https://cf.bstatic.com/xdata/images/hotel/358x238/318189193.jpg?k=1b38ebf507538cd10f53b59f7e9a6b3c6d77a4d3dd1677c1aacae4ed5645f56d&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/anam.html', 'published', NULL, '2021-10-18 19:01:50', '2021-10-18 19:01:55', NULL),
(2, 7565878, 'Collection O 81647 Hotel Minerva Residency', 'Mumbai', 'In response to the coronavirus (COVID-19), additional safety and sanitation measures are in effect at this property.', 'India', NULL, 'Hotel', NULL, '12:00', '11:00', 'INR', '2350.051194372', 'https://cf.bstatic.com/xdata/images/hotel/358x238/310308750.jpg?k=a51a9afb343005fabcda2586f18c220521dbeea531069ab63a5ccbbeb8b26af5&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/collection-o-81647-comfortable-stays-grant-road.html', 'published', NULL, '2021-10-18 19:01:55', '2021-10-19 13:37:16', '2021-10-19 13:37:16'),
(3, 743959, 'Hotel Kumkum', 'Mumbai', 'Stay in the heart of Mumbai.\nOffering a la carte rooftop restaurant, Hotel Kumkum is located in Mumbai. The Chowpatty Beach is 2.5 mi. Free Wi-Fi access is available.\n\nThe beautiful Marine Drive is 2.5 mi, iconic Gateway of India is 5 mi and Juhu Beach is 16 mi. The Mumbai International Airport is 11 mi.\n\nRooms here will provide you with a TV, air conditioning and cable channels. Featuring a shower, private bathrooms also come with free toiletries. Extras include a fan.\n\nAt Hotel Kumkum you will find a 24-hour front desk. Other facilities offered include a ticket service, luggage storage and dry cleaning.\n\nThe rooftop restaurant serves multi-cuisine. Room service is available.', 'India', NULL, 'Hotel', '7.7', '11:00', '09:30', 'INR', '4838.3999884129', 'https://cf.bstatic.com/xdata/images/hotel/358x238/102803378.jpg?k=c6a1e4956fb584ce09a22a8c375de71eae4844cae4730b65505382d422330825&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/kumkum.html', 'published', NULL, '2021-10-18 19:02:00', '2021-10-18 19:02:05', NULL),
(4, 287064, 'The Sahil Hotel', 'Mumbai', 'According to government regulations, a valid Photo ID has to be carried by every person above the age of 18 staying at The Sahil Hotel. The identification proofs accepted are Aadhar Card, Passport, PAN cards are not accepted as ID proof. Without valid ID the guest will not be allowed to check in.', 'India', NULL, 'Hotel', '7.6', '14:00', '12:00', 'INR', '10475.745063499', 'https://cf.bstatic.com/xdata/images/hotel/358x238/314439402.jpg?k=b5061a02f7b2f45d7e36284e11c09bf81f3f470e68d2aeee5097a23385409ec3&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/sahil.html', 'published', NULL, '2021-10-18 19:02:05', '2021-10-18 19:02:10', NULL),
(5, 2824624, 'YMCA International House', 'Mumbai', 'The property will charge a one-time membership fee of INR 140, which is valid for 3 months.', 'India', NULL, 'Hotel', '8.1', '12:00', '12:00', 'INR', '5207.9999875277', 'https://cf.bstatic.com/xdata/images/hotel/358x238/118627995.jpg?k=f52c84f88ff556f2b118872675435bfcd828151e8d8ae39d421b5b08b912b53b&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/ymca-international-house-mumbai.html', 'published', NULL, '2021-10-18 19:02:10', '2021-10-18 19:02:16', NULL),
(6, 6862531, 'Capital O 76484 Hotel Balwas International', 'Mumbai', 'In response to the coronavirus (COVID-19), additional safety and sanitation measures are in effect at this property.', 'India', NULL, 'Hotel', '2.8', '12:00', '11:00', 'INR', '2992.5039929412', 'https://cf.bstatic.com/xdata/images/hotel/358x238/296437449.jpg?k=410f450e463a7664ab85815462516d5f6307c2a59f45e5112ee83521a74392d4&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/capital-o-76484-balwas-international.html', 'published', NULL, '2021-10-18 19:02:16', '2021-10-19 13:37:27', '2021-10-19 13:37:27'),
(7, 7105742, 'Hotel National', 'Mumbai', 'Stay in the heart of Mumbai.\nWell located in the Grant Road district of Mumbai, Hotel National is located 0.7 mi from Girgaum Chowpatty Beach, less than 0.6 mi from Chor Bazaar and 0.8 mi from Girgaon Chowpatty Beach. The property is around 1.3 mi from Crawford Market, 1.7 mi from Haji Ali Dargah and 2 mi from Nehru Science Center. The accommodations provides a 24-hour front desk and room service for guests.\n\nAt the hotel, each room is fitted with a wardrobe and a flat-screen TV.\n\nPopular points of interest near Hotel National include Mohd Ali Road, Kamala Nehru Park and Hanging Gardens. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 9.9 mi from the accommodations.', 'India', NULL, 'Hotel', '7', '12:00', '10:00', 'INR', '2015.999995172', 'https://cf.bstatic.com/xdata/images/hotel/358x238/287200652.jpg?k=ba0c745db48e9ee8a3b2d89db8c0b9b2753e05678a1a04d7873bf8d7f9d22786&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/national-mumbai.html', 'published', NULL, '2021-10-18 19:02:21', '2021-10-18 19:02:26', NULL),
(8, 7105548, 'Hotel New Shalimar', 'Mumbai', 'Stay in the heart of Mumbai.\nHotel New Shalimar features air-conditioned rooms with satellite flat-screen TV in the Grant Road district of Mumbai. This 3-star hotel offers a 24-hour front desk and room service. The property is close to popular attractions like Mohd Ali Road, Kamala Nehru Park and Hanging Gardens.\n\nAt the hotel, rooms come with a wardrobe.\n\nPopular points of interest near Hotel New Shalimar include Girgaum Chowpatty Beach, Chor Bazaar and Girgaon Chowpatty Beach. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 9.9 mi from the accommodations.', 'India', NULL, 'Hotel', '9.3', '12:00', '11:00', 'INR', '3158.3999924362', 'https://cf.bstatic.com/xdata/images/hotel/358x238/287187437.jpg?k=602725a934754c5ceefbaa3a25fa6dae00ba9a62a846a7b8d4261da69fcae8fe&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/new-shalimar-mumbai1.html', 'published', NULL, '2021-10-18 19:02:26', '2021-10-18 19:02:34', NULL),
(9, 5961092, 'Hotel Ashyana', 'Mumbai', 'Stay in the heart of Mumbai.\nHotel Ashyana features air-conditioned rooms with cable flat-screen TV in the Grant Road district of Mumbai. With free WiFi, this 2-star hotel offers a 24-hour front desk and room service. The hotel features family rooms.\n\nAll rooms at the hotel are fitted with a seating area. Guest rooms at Hotel Ashyana are equipped with a private bathroom and bed linen.\n\nPopular points of interest near the accommodations include Girgaum Chowpatty Beach, Chor Bazaar and Mohd Ali Road. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 9.9 mi from Hotel Ashyana.', 'India', NULL, 'Hotel', '7', '12:00', '12:00', 'INR', '2351.9999943674', 'https://cf.bstatic.com/xdata/images/hotel/358x238/233996370.jpg?k=3810802b8fa568c73a2009ff6f23813437bfe2b6cb0c08a636334e5dea8a1ec4&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/ashyana-mumbai1234567891011.html', 'published', NULL, '2021-10-18 19:02:34', '2021-10-18 19:02:41', NULL),
(10, 3763032, 'Hotel Orient Regency', 'Mumbai', 'Stay in the heart of Mumbai.\nLocated in Mumbai, 0.7 mi from Girgaum Chowpatty Beach, Hotel Orient Regency features a terrace and views of the city. Among the facilities of this property are a restaurant, a 24-hour front desk and room service, along with free WiFi throughout the property. The accommodations features valet parking, luggage storage space and currency exchange for guests.\n\nThe hotel will provide guests with air-conditioned rooms offering a desk, a kettle, a fridge, a safety deposit box, a flat-screen TV and a private bathroom with a shower. At Hotel Orient Regency rooms are equipped with bed linen and towels.\n\nThe accommodations offers a continental or buffet breakfast.\n\nPopular points of interest near Hotel Orient Regency include Chor Bazaar, Mohd Ali Road and Girgaon Chowpatty Beach. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 9.9 mi from the hotel.', 'India', NULL, 'Hotel', '7.5', '12:00', '11:00', 'INR', '4535.0927891392', 'https://cf.bstatic.com/xdata/images/hotel/358x238/153431825.jpg?k=b6192fff0fb48b718aaa6ea31d882d76cfeef26040197520fac36d8935d90fbb&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/orient-regency.html', 'published', NULL, '2021-10-18 19:02:41', '2021-10-18 19:02:53', NULL),
(11, 259795, 'Krishna Palace Hotel', 'Mumbai', 'Stay in the heart of Mumbai.\nHotel Krishna Palace Residency offers comfortable rooms located a 15-minute drive from commercial centers like Nariman Point and Cuffe Parade. It offers a health club, 2 restaurants and free parking.\n\nKrishna Palace Residency Hotel is 14 mi from Chatrapathi Sivaji International Airport and a 5-minute walk from the local railway station. Dentzz Dental Care (Kemps Corner) is 2789 feet while Worli is 2.5 mi away from the property.\n\nSpacious rooms are fitted with Wi-Fi access and satellite channels. They are equipped with a safe, mini-bar and tea/coffee making facilities. The private bathroom is large enough to accommodate a bathtub, and has a hairdryer and amenities.\n\nA business center is available. The hotel also provides airport shuttle, concierge and laundry services.\n\nKrishna Palace’s multi-cuisine restaurant offers a range of local and international dishes. There is also a vegetarian restaurant that offers Jain dishes.', 'India', NULL, 'Hotel', '6.9', '14:00', '12:00', 'INR', '19410.174117655', 'https://cf.bstatic.com/xdata/images/hotel/358x238/76400779.jpg?k=c337092b61df9724b49dbb96938b33a9e59c1a7eb553ee116a51cd3da368ad37&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/krishna-palace-residency.html', 'published', NULL, '2021-10-18 19:02:53', '2021-10-18 19:03:00', NULL),
