(20, 355007, 'Hotel Kemps Corner', 'Mumbai', 'Stay in the heart of Mumbai.\nHotel Kemps Corner offers air-conditioned rooms with free Wi-Fi in Mumbai, about 0.9 mi from Breach Candy Shopping Center and Colaba Causeway. The hotel also provides 24-hour room service and a free buffet breakfast.\n\nAir-conditioned rooms all come with a flat-screen TV and tea/coffee making facilities. Private bathrooms are equipped with hot-water showers.\n\nHotel Kemps Corner is within 3.7 mi from Mumbai Central Station and Nariman Point. It is 11 mi from Chhatrapati Shivaji International Airport.\n\nDay trips and car rentals can be arranged at the tour desk. Laundry services and a 24-hour front desk are also available.', 'India', NULL, 'Hotel', '7.7', '14:00', '12:00', 'INR', '8959.9999785423', 'https://cf.bstatic.com/xdata/images/hotel/358x238/235826396.jpg?k=c6e78fb2af150f8a4b34509dc5472f3708b3cb32455cfab3f2ba893a349a41c2&o=', '18.968976974487', '72.818969726562', 'https://www.booking.com/hotel/in/kemps-corner.html', 'published', NULL, '2021-10-18 19:03:51', '2021-10-18 19:03:56', NULL),
