(22, 255412, 'The Park Navi Mumbai', 'Navi Mumbai', 'Located in the Central Business District of Belapur, this property features an outdoor pool, a gym and a restaurant. Its rooms offer a flat-screen TV, internet access and 24-hour room service.\n\nFitted with wooden flooring, air-conditioned rooms feature cable TV and a DVD player. Coffee/tea making facilities and a mini-bar are included. Private bathrooms come with a hairdryer.\n\nBamboo serves Chinese dishes, while Dusk offers a wide selection of alcoholic drinks and cigars, accompanied with music. West 1 is a contemporary restaurant which features local and international dishes.\n\nGuests can go for a massage at The Park’s spa or relax in the sauna. Other facilities include a business center and a tour desk. The 24-hour front desk can assist with laundry and currency exchange services.', 'India', NULL, 'Hotel', '7.7', '14:00', '12:00', 'INR', '11197.759973183', 'https://cf.bstatic.com/xdata/images/hotel/358x238/265186728.jpg?k=7d68bb3aa444a3ffbeadcaadec890038b779dc614a840967cb5e442ffa9d07a5&o=', '19.02152', '73.03226', 'https://www.booking.com/hotel/in/the-park-navi-mumbai-navi-mumbai.html', 'published', NULL, '2021-10-18 19:04:05', '2021-10-18 19:04:10', NULL),
