(29, 7178710, 'Hotel Sea Shore', 'Navi Mumbai', 'Located within 1.9 mi of Nerul Lake and nature park and 2 mi of Kharghar Hills, Hotel Sea Shore offers rooms with air conditioning and a private bathroom in Navi Mumbai. Around 2.2 mi from DY Patil Cricket Stadium, the property is also 2.7 mi away from Utsav Chowk and offers free WiFi. The accommodations provides a 24-hour front desk and room service for guests.\n\nAll units at the hotel are equipped with a seating area and a flat-screen TV.\n\nInorbit Mall, Vashi is 4.3 mi from Hotel Sea Shore, while Sagar Vihar is 5.6 mi away. The nearest airport is Chhatrapati Shivaji International Airport Mumbai Airport, 12 mi from the accommodations.', 'India', NULL, 'Hotel', '5.3', '10:00', '11:30', 'INR', '3023.999992758', 'https://cf.bstatic.com/xdata/images/hotel/358x238/291857897.jpg?k=50a40543a00173234a48e4244743833f69711a34a04573e9a6ee289d95ce0717&o=', '19.02152', '73.03226', 'https://www.booking.com/hotel/in/sea-shore-navi-mumbai.html', 'published', NULL, '2021-10-18 19:04:44', '2021-10-18 19:04:51', NULL),
