(33, '743959', 'Laura', '2020-03-09 13:18:22', 'Pleasant', 'The staff were amazing!!! They should be all working at “ The Taj Palace Hotel”.!! Their attention to detail to help us change rooms and their willingness and quick response to help us when we had no power, no hot water and no internet was wonderful. They could not have tried harder to please us. The manager was especially wonderful. He is underrated at this place and should be at a five star resort. But truly ALL the staff are recommended and helpful. I can’t express this enough. It is not their fault that the facilities at the hotel are not good. It is not their fault that the beds are a thin cot and the linens are old. It is not their fault that a “ basic” room is called a “ superior “ room. It is not their fault that there is no shower stall in the unrenovated rooms but simply a faucet I. The bathroom that acts as a shower.', '2021-10-18 17:02:03', '2021-10-18 17:02:03', NULL),
