(322, '355007', 'Kerman', '2021-10-01 11:02:29', 'Booking.com NOT HELPFUL when we are in trouble.... you are left to fend for your own.', 'Lot of facilities mentioned on booking.com were not available at the property. All the hotel staff were extremely courteous and helpful when they noticed what had happened. \r\nThe hotel appologized for the missing elements but booking.com did not revert back. If this is the service for a Genius L2 customer, what do you expect from them.', '2021-10-18 17:03:54', '2021-10-18 17:03:54', NULL),
