(340, '355007', 'Pranay', '2021-07-19 14:55:03', 'Pathetic.', 'The female  receptionist was rude to the limit, i had ask for tea n with seconds the tea was there as they were knowing that i will ask for tea. Tea was prepared atleast 2 hr before n reboiled several times, no masala. I wont suggest this hotel to anyone. The problem was may be they didnt taught how to speak with guest..', '2021-10-18 17:03:54', '2021-10-18 17:03:54', NULL),
(341, '355007', 'Zenobia&aman', '2021-07-18 13:12:57', 'A Great Weekend Staycation!!', 'The staff was especially WARM n WELCOMING. They didn\'t say no for anything. They cleaned our room at even 11:15 in the night. And in the morning they also gave us great breakfast in the room which was a fixed/ set unlimited menue. \nThe hotel room was very clean and well sanitized. The towels were clean too and so was the bathroom. \nOverall a very comfortable stay, will surely visit again! \n', '2021-10-18 17:03:54', '2021-10-18 17:03:54', NULL),
